import React, { Component } from "react";
import { Row, Col } from "react-bootstrap";

const MainStatsCard = ({...props}) => (
      <div className="card card-stats">
        <div className="content">
        <h3>ACTIVE CASES</h3>
                <hr />
          <Row>
            <Col xs={12}>
                
              
            </Col>
            <Col xs={7}>
              <div className="numbers">
                <p>{props.statsText}</p>
                {props.statsValue}
              </div>
            </Col>
          </Row>
        </div>
      </div>
);

export default MainStatsCard;
